// External Imports
import React, { Component } from 'react';
import * as d3 from 'd3';
import * as topojson from 'topojson';

// Internal Imports
import './Choropleth.css';

// Data
import eapCountryData from '../../../data/ChoroplethData/eap_all_by_subnatid1_topojson.json';

class Choropleth extends Component {
  state = {
    eapCountryData: null,
  }

  componentDidMount() {
    console.log(eapCountryData);
    this.setState({
      eapCountryData: eapCountryData,
    }, 
      () => {
        this.renderMap();
      }
    );
  }  

  renderMap = () => {
    const { eapCountryData } = this.state;
    const eapCountries = topojson.feature(eapCountryData, eapCountryData.objects.eap_all_by_subnatid1_shapefile).features
  }

  render() { 
    return (
      <div>
        <svg ref='anchor' width={960} height={600} />
      </div>
    );
  }
}

export default Choropleth;
